import React, { Component } from "react";

export default class Card extends Component<{
  children?: React.Node
}> {
  render() {
    return (
      <div className="card w-25 m-4 border-0">
        <div className="card-body">
          <div className="card-text">{this.props.children}</div>
        </div>
      </div>
    );
  }
}
